import React from "react";

function Food({ name, picture }) {
  return (
    <div>
      <h2>I like {name}</h2>
      <img src={picture} />
    </div>
  );
}

const foodIKike = [
  {
    name: "삼겹살",
    image:
      "data:image/jpeg;base64,",
  },
  {
    name: "치킨",
    image:
      "data:image/jpeg;base64,",
  },
  {
    name: "국밥",
    image:
      "data:image/jpeg;base64,",
  },
  {
    name: "햄버거",
    image:
      "data:image/jpeg;base64,",
  },
];

function renderFood(dish) {
  return <Food name={dish.name} picture={dish.image} />;
}

function App() {
  return <div>{foodIKike.map(renderFood)}</div>;
}

export default App;
